sub tajima();
sub tajima(){
	
	my $Population=shift;
	my($ref)=@_;

	my $pi_tajima=(2/($Population*($Population-1)));
	my $sum=0;
	#_________ Hammer distance of Pairs of secuences on a group of n sequences
	 my @KEYS =keys %$ref;

	for (my $i=0;$i<@KEYS;$i++){
		for (my $j=0;$j<$i;$j++){ ## All sequence pairs
			my $dist=&Hamming("$ref->{$KEYS[$i]}", "$ref->{$KEYS[$j]}");
			$sum+=$dist;
		}
	}

	$pi_tajima*=$sum;

	return $pi_tajima;
}

