#_ Input Data for Random Simulations
sub random_sequences(){	
	my @SEQ;
	my $Population=10;  ## Population Size
	my $SeqLen=50; ## Aligned Sequences size

	## FIll sequences
	for(my $i=1;$i<=$Population;$i++){ ##Fill %Individuos with a population size of $Population
		$Sequences{$i}="";        
		for(my $j=1;$j<=$SeqLen;$j++) {    ##each sequence with size $SeqLen
			my $random=int(random(.5,4.5,.1));
			if ($random == 0){$Sequences{$i}.="A";}
			if ($random == 1){$Sequences{$i}.="C";}
			if ($random == 2){$Sequences{$i}.="G";}
			if ($random == 3){$Sequences{$i}.="T";}
			if ($random == 4){$Sequences{$i}.="-";}
			}
			$SEQ[$i]=uc($Sequences{$i});
		}
	my $len=$SeqLen;
	return $len, $Population,@SEQ;
	}
#_____________________________________________________________________________________________________________


sub real_sequences(){
	my (%REAL)=@_;
	my @SEQ;
	my $Population=keys %REAL;  ## Population Size
	#print("\nPOPULATION: $Population\n");
	my $i=1;
	foreach my $key (keys %REAL ){ ##Fill %Sequences with a population size of $Population
		$Sequences{$i}=uc $REAL{$key};
		$SEQ[$i]=uc($Sequences{$i});
		$i++;        		
		}

	my $len=length $Sequences{1}; ## Aligned Sequences size
	return $len, $Population, @SEQ;
	}

