#_________________Constants
##an from Waterson Estimator  ##bn from D-Tajima

sub CalculateConstants(){
	my $Population=shift;
	my $an=0; ##an from Waterson Estimator
	my $bn=0; ##bn from D-Tajima
	my $e1;
	my $e2;

	for (my $i=1;$i<$Population;$i++){$an+=1/$i;} 

	for (my $i=1;$i<$Population;$i++){$bn+=1/($i*$i);} 

	### e1 from D-Tajima
	$e1=($Population+1)/(3*$an*($Population-1))-1/($an*$an); 

	## e2 from D-Tajima
	$e2=(1)/($an*$an+$bn)*((2*($Population*$Population+$Population+3))/((9*$Population)*($Population-1))-($Population+2)/($Population*$an)+$bn/($an*$an));

	return $an,$bn,$e1,$e2;
}

