sub Count_perSite(){
	## Here I store sequences in the Hash of arrays "splited"
	my $len=shift;
	my @SEQ=@_;
	my %splited;
	
	for (my $i=0;$i<=$len;$i++){ ## Each site on a sequence
	$Counts{$i}=[0,0,0,0,0];	
	}

	for (my $i=1;$i<scalar @SEQ;$i++){
		$splited{$i}=[split("",uc$SEQ[$i])];	

		for (my $j=0;$j<$len;$j++){
			if ($splited{$i}[$j]eq"A") {
				$Counts{$j}[0]++;
				}
			if ($splited{$i}[$j]eq"C") {
				$Counts{$j}[1]++;
				}
			if ($splited{$i}[$j]eq"G") {
				$Counts{$j}[2]++;
				}
			if ($splited{$i}[$j]eq"T") {
				$Counts{$j}[3]++;
				}
			if ($splited{$i}[$j]=~/[^ACGT]/){ 
				$Counts{$j}[4]++;
				}
			}
		}
	}
