sub Segregation(){
	my $Sites=0;
        my $len=shift;
        my $Population=shift;
	## Counts, HAsh of arrays with Counts of [%A, %C, %G, %T, %-]
	
	for (my $i=0;$i<$len;$i++){ ## Pasando por cada lugar en la secuencia
		$Percentages{$i}=[100*$Counts{$i}[0]/$Population,100*$Counts{$i}[1]/$Population,
                                            100*$Counts{$i}[2]/$Population,100*$Counts{$i}[3]/$Population,
                                            100*$Counts{$i}[4]/$Population];

		my $Segregation=0; ## Flag of segregation site
		for my $per ( @{ $Percentages{$i} }){
			if (0<$per and $per<100){
				$Segregation =1;			
				}
			}
			if($Segregation ==1){
				$Sites++;
			}
		
		}
	return $Sites;
	}
