###Factorial of a number
sub factorial(){
	my $r=$_[0];
	if ($r==0){return 1;}
	my $fac=1;
	for (my $i=$r;$i>1;$i--){
		$fac*=$i;	
		}
	#print "\n$r factorial es $fac\n";	
	return $fac;	
}
#___________________________________________________________________________

#Combinations r-groups of n elements
sub r_on_n(){  ##Works for what we need, small numbers, may have memory problems for bignumbers
	my $r=$_[0];
	my $Population=$_[1];
	my $fac=&factorial($r);
	my $comb=1;  ## I have try to reduce operations
	for (my $i=$r;$i>=1;$i--){
		$comb*=($Population-$i+1);	
		}
	$comb/=$fac;
	#print $comb;
	return $comb;
}

