sub Tajima(){
	my $Population=shift;

	my($ref)=@_;

	my $pi_tajima=(2/($Population*($Population-1)));
	my $sum=0;
	#_________ Hammer distance of Pairs of secuences on a group of n sequences
	foreach my $key(keys %$ref){
		for (my $j=1;$j<$key;$j++){ ## All sequence pairs
			#print("\n$i, $j \n");
			my $dist=&Hamming("$ref->{$key}", "$ref->{$j}");
			$sum+=$dist;
			#print ("Hamming distance= $dist \n");
		}
	}

	$pi_tajima*=$sum;
	return $pi_tajima;
}
