sub Hamming(){ ## Rigth now Im using number of differences, but I also know wich ones are.
	my $s1=$_[0];
	my $s2=$_[1];

	$s1=uc($s1); ## Capitalice to avoid account differences lika a-A, t-T etc
	$s2=uc($s2);

	my $diff = $s1 ^ $s2;
	my $SegSites=0;
	my @dpos;

		push @dpos, [ $-[1], $+[1] - $-[1] ]
    	while $diff =~ m{ ([^\x00]+) }xmsg;

	for (@dpos){
		$SegSites+=$_->[1];
	}

	#print $sum;

		#print qq{diff at offset $_->[0], length $_->[1], \n}
	#for @dpos;


	(my $mask = $diff) =~ tr{\x00}{\xff}c;

	$s1 &= $mask;
	$s2 &= $mask;

	my $differences = qr{ [^\x00]+ }xms;

	@dpos = ();
	while ($s1 =~ m{ ($differences) }xmsg) {
    		# this code produces same result
    		# my @diff_data = ($1);
		# $s2 =~ m{ ($differences) }xmsg;
		# push @diff_data, $1, $-[1];
	        # push @dpos, \@diff_data;
    		push @dpos,
         	[ $1, do { $s2 =~ m{ ($differences) }xmsg && $1, $-[1] } ];
    		}

	#print qq{@$_ \n} for @dpos;
	return $SegSites;
}
