#p-distance	Proportion of sites at which the two sequences are different. p is close to 1 for poorly related sequences, and p is close to 0 for similar sequences.
#d = p
sub proportion();

sub proportion(){
	my $seq1=$_[0];
	my $seq2=$_[1];
  	my $hamming=&Hamming($seq1,$seq2);
  	my $len=length($seq1);
  	my $proportion=$hamming/$len;
  	return $proportion;
}

