#Maximum likelihood estimate of the number of substitutions between two sequences. p is described with the method p-distance.
#For amino acids:
#d = -19/20 log(1-p * 20/19)

sub jukesAmino(){
	my $seq1=$_[0];
	my $seq2=$_[1];
 	my $hamming=&Hamming($seq1,$seq2);
 	my $len=length($seq1);
 
 	my $p=$hamming/$len;
        my $d = -(19/20) *ln(1-$p * 20/19);
 	return $d;
}

