}
#For nucleotides:
#d = -3/4 log(1-p * 4/3)

sub jukesNucleo(){
	my $seq1=$_[0];
	my $seq2=$_[1];
	my $hamming=&Hamming($seq1,$seq2);
  	my $len=length($seq1);
  	my $p=$hamming/$len;  
        my $d = -(3/4)*ln(1-$p * 4/3);
  	return $d;
}

